import React from 'react';

export class SearchBar extends React.Component {
    constructor(props) {
        super(props);
        this.searchTerm = props.filterText;
        this.inStockOnly = props.inStockOnly;
    }

    render() {
        return (
            <div>
                <div>
                    <input type="text" value={this.searchTerm} />
                </div>
                <p>
                    <input type="checkbox" value={this.inStockOnly} />
                    <label>Only show products in stock</label>
                </p>
            </div>
        );
    }
};
